<script lang="ts">
	import { Board } from '$lib/index.js';

	let board = $state(null);
	let lastEvent = $state('none')

	let singleTouchPan = $state(true);
	let doubleTouchPan = $state(true);
	let mousePan = $state(true);
	let coords = {x: 0, y: 0}

	$inspect(board);

	function handleEvent(name: string, e: any) {
		lastEvent = name;
		console.log(e)
	}

	let b;

	function handleStart(name: string, e: any) {
		lastEvent = name;

		if (b)
			coords = b.screenToBoard({x: e.clientX, y: e.clientY})
	}
</script>

